import React from 'react';
import propTypes from 'prop-types';

const PostImages = ({ images }) => {
	if (images.length === 1) {
		return <></>;
	}
	if (images.length === 2) {
		return <></>;
	}

	return <></>;
};

PostImages.propTypes = {
	images: propTypes.string,
};
